import React, { useState, useEffect } from "react";
import Form from "./Components/Form";

const Test = () => {
	const [count, setCount] = useState(0);

	const tick = () => {
		setCount(count + 1);
		console.log(count);
	};

	useEffect(() => {
		let x = setInterval(tick, 1000);
		return () => {
			clearInterval(x);
		};
	}, [count]);

	return <div>{count}</div>;
};

export default Test;
